import styled from "styled-components/native";
import { Colors } from "../../constants";

export const SosButton = styled.TouchableOpacity`
  width: 60px;
  height: 60px;
  border-radius: 30px;
  background-color: ${Colors.darkPink};
  margin-left: 17.95%;
  margin-right: 17.95%;
  margin-top: 35.19%;
  margin-bottom: 35.19%;
`;

export const SosContainer = styled.View``;
